import React from "react";
import './private-info.css';
import {Form, Input} from "antd";
import 'antd/dist/antd.css';



const Items = (infos) => {

    return ( infos.map((item) => {
        return (
            <Form.Item key="" >
                <Input defaultValue = {item}/>
            </Form.Item>
        )
    }
    ));
}


export default Items;
